package manager;

import java.io.FileWriter;
import java.io.IOException;
import java.nio.file.Files;
import java.nio.file.Path;
import java.nio.file.Paths;
import java.util.Base64;
import java.awt.image.BufferedImage;
import java.io.ByteArrayInputStream;
import java.io.File;
import javax.imageio.ImageIO;


import javax.servlet.ServletContext;

import org.json.simple.JSONObject;

public class DataManager {
	public static DataManager inst = null;
	public static final String EMPTY_PATH = "./";
	public static final String ADMIN_FILE = "./admin.json";
	
	private JSONObject mConfig;
	private ServletContext mContext;
	private boolean isReady;
	
	public DataManager() {
		mConfig = new JSONObject();
		mConfig.put("테스트", "10");
		
		isReady = false;
	}
	
	public void setMainApplication(ServletContext context) {
		mContext = context;
		if(mContext != null) {
			isReady = true;
		}
	}
	
	public void makeConfigFile() {
		String root = getApplicationPath();
		Path outputPath = Paths.get(root, "output.json");
		
		System.out.println(outputPath);
		
		try (FileWriter writer = new FileWriter(outputPath.toString())) {
			writer.write(mConfig.toJSONString());	
		} catch(Exception ex) {
			
		}		
	}
	
	public String getApplicationPath() {
		if(!isReady) {
			return DataManager.EMPTY_PATH;
		}
		return mContext.getRealPath(".");
	}
	
	public void convertBlobToImageFile(String raw, String filename) {
		
		
		if(raw == null) {
			return;
		}
		
		if(raw.isEmpty()) {
			return;
		}
		
//		String raw = "data:image/png;base64,";
		String base64Data = raw.split(",")[1];
		
		byte[] decodedBytes = Base64.getDecoder().decode(base64Data);
		ByteArrayInputStream bis = new ByteArrayInputStream(decodedBytes);
		BufferedImage image = null;
		try {
			image = ImageIO.read(bis);
		} catch (IOException e) {
			// TODO Auto-generated catch block
			e.printStackTrace();
		}
		
		String root = getApplicationPath();
		Path parentFolderPath =  Paths.get(root, "uploads");
		Path outputPath = Paths.get(parentFolderPath.toString(), filename);
		
		if(!Files.exists(parentFolderPath)) {
			try {
				Files.createDirectory(parentFolderPath);
			} catch (IOException e) {
				// TODO Auto-generated catch block
				e.printStackTrace();
			}
		}
		
		File outputFile = new File(outputPath.toString());
		try {
			ImageIO.write(image, "png", outputFile);
		} catch (IOException e) {
			// TODO Auto-generated catch block
			e.printStackTrace();
		}  		
	}
	
	
	public static synchronized DataManager getInstance() {
		if(inst == null) {
			inst = new DataManager();
		}
		
		return inst;
	}
	
}
